import { CREATE_ACCOUNT, LOG_IN, LOGIN_SUCCESS } from '../actions/types';

const initialState = {
    isLogged : false,
    user: []
}

export default function(state = initialState, action) {
    switch (action.type) {
        case CREATE_ACCOUNT:
            console.log('reducer')
            return {
                ...state
            };
            case LOG_IN: 
            return {
                ...state,
                isLogged: true,
                user: action.payload
            }
            case LOGIN_SUCCESS:
            
        default:
            return state;
    }
}
